description:
Play as Dr. House and the skilled staff at Princeton-Plainsboro Hospital, as you race to unravel medical mysteries. Track down the correct diagnosis by interviewing and examining patients, performing lab tests, surgery, and more. The clock is ticking, but be prepared for multiple twists and turns before you solve each different case in House, M.D.!


System Requirements:

OS: Windows XP/Vista/7

CPU: 1.2 GHz
RAM: 512 MB
DirectX: 9.0
Hard Drive: 332 MB

